INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 1, 125801, 2, 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 321, "リリ", 1, 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 1, 126001, 2, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 322, "クリア", 1, 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 1, 126101, 2, 0, "んーと。\nこれ、あげる。\nはい", 24001, 323, "プレシア", 1, 3);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 1, 125801, 2, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 324, "リリ", 2, 4);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 1, 126001, 2, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 325, "クリア", 2, 5);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (40011, 1, 126101, 2, 0, "お兄。\nきてくれて、うれしい", 24001, 326, "プレシア", 2, 6);
